		"text": "A2: I always finding this interesting to reflect on as a geographer. Geography is inherently focused on international perspectives - but it‚Äôs often with a very ‚ÄòWestern‚Äô lens. Critical geographies and an acknowledgement of colonial influences really opened the field.  #LTHEchat"
